import './styles.css';
import React from 'react'
import { connect } from 'react-redux';

const Baby = ({babies,}) => (
    <div className="container">
        <div className="baby">
        <select id="cars" name="cars">
            {babies.forEach(baby => {
                <option value={baby[id]}>{baby[name]+" "+baby[lastname]}</option>
            })}
        </select>
        </div>
    </div>
)

export default connect(
    undefined,
    undefined
)(Baby)
